import React, { Fragment } from "react";

const Filters = () => {
  return (
    <Fragment>
      <form className="bd-search d-flex align-items-center">
        <span className="algolia-autocomplete">
          <input
            type="search"
            name=""
            id=""
            className="form-control ds-input"
          />
        </span>
      </form>
    </Fragment>
  );
};

export default Filters;
